import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./LoginForm.css";

const LoginForm = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [rememberMe, setRememberMe] = useState(false);
  const [error, setError] = useState("");

  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    setError("");

    try {
      const response = await fetch("https://qa-uaesaas-api.instapract.ae/web/api/default/login", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          APPID: "Gem3s12345",
        },
        body: JSON.stringify({
          username,
          password,
          role_id: "143f37f2-ca38-0ab1-2489-1e47113655fc",
          device_id: "55c3389cb5ddd720dc0297617f3561c43a36218a277c974c8d43d545a643f45c",
          os_id: "b93a9204-ee21-4cf9-8a94-cf5eeabf7301",
          language: "da315627-3ece-2016-c628-b61dc5ee9be0",
        }),
      });

      const result = await response.json();
      if (response.ok && result.success && result.data.access_token) {
        localStorage.setItem("token", result.data.access_token);

        // ✅ Save user info
        localStorage.setItem("user", JSON.stringify(result.data.user));

        navigate("/doctor");
      } else {
        setError(result.msg || "Login failed");
      }
    } catch (err) {
      console.error(err);
      setError("Something went wrong. Please try again.");
    }
  };

  return (
    <div className="login-wrapper">
      <div className="image-box">
        <p>
          Instapract<br />
          User Centric <br />
          Teleconsulting,<br />
          Expert Opinion<br />
          Platform.
        </p>
      </div>
      <div className="login-box">
        <form onSubmit={handleLogin} className="login-form">
          <div className="Form-title">
            <h2><span>Insta</span>pract</h2>
            <h5>HealthTech IT Solution</h5>
          </div>
          <h2 className="login-title">Login</h2>

          <div className="form-group">
            <label>Username</label>
            <input
              type="text"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
              required
            />
          </div>

          <div className="form-group">
            <label>Password</label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </div>

          <div className="form-group remember-me">
            <input
              type="checkbox"
              id="rememberMe"
              checked={rememberMe}
              onChange={(e) => setRememberMe(e.target.checked)}
            />
            <label htmlFor="rememberMe">Remember Me</label>
          </div>

          {error && <div className="error-message">{error}</div>}

          <button type="submit" className="login-button">Login</button>
        </form>
      </div>
    </div>
  );
};

export default LoginForm;
